import React, { useState } from 'react';
import PropTypes from 'prop-types';

const AddPage = ({ currentView, handleBackClick }) => {

    const [formData, setFormData] = useState({
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('/api/mobil/add', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(formData)
            });
            const data = await response.json();
            if (response.ok) {
                console.log('Response:', data);
                alert('Data mobil berhasil ditambahkan!');
                handleBackClick(); // Kembali ke halaman sebelumnya
            } else {
                console.error('Error:', data);
                alert('Gagal menambahkan data mobil.');
            }
        } catch (error) {
            console.error('Error submitting form:', error);
            alert('Gagal menambahkan data mobil.');
        }
    };

    return (
        <div className="row">
            <div className="col-lg-12">
                <div className="mb-3">
                    <div className="divider text-start">
                    <div className="divider-text">
                        <span className="menu-header-text fs-6">Tambah Data Mobil</span>
                    </div>
                    </div>
                </div>
            </div>
            <div className="col-lg-12">
                <div className="">
                    Klik <button className="fw-bold btn btn-link p-0" onClick={handleBackClick}>disini</button> untuk kembali ke menu utama Mobil.
                </div>
            </div>
            <div className="col-md-12 mt-3">
